py::array_t<double> interfacemonotonic_GRF_PolAB_A_A(py::array_t<double> parsar, py::array_t<double> othervars ) {
    typedef long double T;

    vector<T> num;
    vector<T> den;
    vector<double> result;
    GRF_PolAB_A_A(parsar,num,den,othervars);

    result=compute_monotonic(num,den); //return {-1} if derivative is 0, {-2} if no roots for the derivative of the GRF, -3 for each root out of the 10^-10,10^10 range, and the roots otherwise
    int n=result.size();
    py::array_t<double> resultpy = py::array_t<double>(n);
    py::buffer_info bufresultpy = resultpy.request();
    double *ptrresultpy=(double *) bufresultpy.ptr;
    for (int i=0;i<n;i++){
        //py::print("Result is",result[i]);
        if (result[i]<-0.5){
        ptrresultpy[i]=result[i];
        }else{
        if ((result[i]<pow(10.0,10))&&(result[i]>pow(10.0,-10))){
            ptrresultpy[i]=result[i];
        }else{
            ptrresultpy[i]=-3;
        }
        }
    }
    return resultpy;
    
    }

py::array_t<double> interface_rhos_GRF_PolAB_A_A(py::array_t<double> parsar, py::array_t<double> othervars, double varGRFval ) {

    typedef long double T;

    vector<T> rhos;
    rhos_GRF_PolAB_A_A(parsar,rhos,othervars,varGRFval);

    int n=rhos.size();
    py::array_t<double> resultpy = py::array_t<double>(n);
    py::buffer_info bufresultpy = resultpy.request();
    double *ptrresultpy=(double *) bufresultpy.ptr;
    for (int i=0;i<n;i++){
    ptrresultpy[i]=rhos[i];
    }
    return resultpy;
    
    }

